  "91ff22cfdfae4000a6d9": "Il PCI DSS (Payment Card Industry Data Security Standard) è lo standard globale di sicurezza dei dati per il settore delle carte di pagamento. Il PCI DSS è stato sviluppato dalle principali organizzazioni di carte di credito come Visa, MasterCard e American Express, con l'obiettivo di proteggere i dati dei titolari delle carte e prevenire frodi con carte di credito, hacking e vulnerabilità della sicurezza.\n\nIl PCI DSS è costituito da 12 requisiti di sicurezza fondamentali che comprendono: sicurezza della rete, protezione dei dati, gestione delle vulnerabilità, controllo degli accessi, monitoraggio della rete e politiche relative alla sicurezza delle informazioni. Tutti i commercianti e i fornitori di servizi che gestiscano, archivino o trasmettano i dati della carta di credito devono rispettare questi standard.\n\n{brandName} dispone della certificazione PCI e questo garantisce la conformità delle proprie misure di sicurezza relative ai dati rispetto agli standard riconosciuti a livello internazionale. Questa certificazione rappresenta una protezione efficace contro frodi e violazioni relazionate alle informazioni delle carte di credito e altri dati sensibili dei clienti.",
  "91xXw22xZhCYxYVeDdhx4i": "Numero massimo di file caricati: {num}.",
