  "99k7WVk3eymfiacNiM2JLv": "<span>Chiave pubblica:</span> la tua <a href='{url}' target='_blank'>chiave pubblica</a> è simile all'indirizzo del tuo wallet. Puoi condividerla per ricevere fondi o utilizzare applicazioni decentralizzate (<a href='{dappsurl}' target='_blank'>dApp</a>). Viene generata dalla chiave privata, ma non consente di conoscere o dedurre la <a href='{url2}' target='_blank'>chiave privata</a>.",
