  "9b49625b13694000aa6f": "Il sistema di sicurezza per gli account di {brandName} è composto da due parti: verifica e controllo del rischio. Il nostro protocollo di controllo del rischio implementa strategie anti-phishing per diversi scenari, ad esempio accessi, prelievi e modifiche alle impostazioni di sicurezza. Per valutare i potenziali rischi vengono esaminati i dispositivi degli utenti, gli indirizzi IP e il comportamento passato. Nel caso venga rilevato un rischio, il sistema avvia ulteriori passaggi di verifica per garantire la sicurezza degli account in base allo scenario specifico.",
  "9bb956f7b7d74000a302": "Gestione degli ID dei dispositivi",
  "9bedd0200f824000a39c": "{brandName} dispone di una piattaforma unificata per la gestione e l'analisi dei registri operativi e di sicurezza. Ciò garantisce che tutti i comportamenti e le attività vengano registrati in modo immutabile per ottemperare ai requisiti normativi, consentire il monitoraggio, supportare le indagini e garantire la tracciabilità.",
