  "a775e0c384f34000a3a8": "{brandName} implementa la segregazione delle autorizzazioni per i KPI degli utenti, comprese le autorizzazioni generali e quelle relative a trading spot, margine e future. Livelli di autorizzazione diversi corrispondono a operazioni differenti, impedendo azioni correlate ad autorizzazioni incrociate. Gli utenti devono prima accedere ai propri account per modificare le autorizzazioni in modo da garantire la sicurezza dei fondi.",
  "a7P3fAoqk4dH8uaFvzj6Kq": "Minimo: {rate}",
  "a840f10cc4cf4000a46e": "Chiavi API e segregazione degli account",
  "a8TpUFNDSYShm4cRjT5y1b": "Scoprine di più",
  "a8c95b5ee1ea4000aebf": "La protezione della riservatezza dei dati degli utenti è la nostra massima priorità. {brandName} implementa misure di sicurezza avanzate per garantire la privacy dei dati e prevenire l'accesso non autorizzato. I dati sensibili, tra cui password, chiavi delle transazioni e informazioni personali d'identificazione, sono protetti utilizzando le misure più rigorose. Questi dati vengono elaborati con metodi zero-knowledge proof, garantendo che persino la piattaforma non possa accedere a queste informazioni senza l'esplicita autorizzazione dell'utente. Inoltre, tutti i dati sensibili vengono crittografati utilizzando algoritmi di crittografia avanzati per migliorare ulteriormente la sicurezza.\n\nLa piattaforma utilizza database dedicati e sistemi appositamente progettati per archiviare informazioni sensibili, fornendo un ulteriore livello di sicurezza. Questi database operano in ambienti di rete interni strettamente controllati. I metodi di containerizzazione assicurano che ogni servizio venga eseguito in un container separato, mantenendo i servizi divisi da un livello d'isolamento. Questo approccio garantisce che i servizi non possano accedere in modo incrociato ai dati sensibili persino all'interno della piattaforma. Tutto questo garantisce la sicurezza dei dati mantenendo la piattaforma stabile e scalabile.",
  "a8oyZqZr6dz72wSfrpqKCc": "Base",
  "a9b72c3a46494000a10c": "1. Collaboriamo con istituzioni autorizzate e raggruppiamo regolarmente i fondi in conti bancari istituzionali affidabili per garantire la sicurezza dei fondi degli utenti.\n2. Verifichiamo che il nome del conto del depositante corrisponda al conto dell'utente per evitare il rischio di frodi e problemi di conformità.\n3. Verifichiamo che il nome del conto del destinatario corrisponda al conto per i prelievi dell'utente, in modo da evitare il rischio di frodi e problemi di conformità.\n4. Tutte le transazioni di deposito e prelievo richiedono il completamento della verifica KYC (Know Your Customer) avanzata.",
  "a9dae303ab5e4000a56d": "Non è possibile accedere alle password e ad altri dati sensibili senza l'autorizzazione esplicita da parte dell'utente. {brandName} utilizza rigorose misure d'autenticazione per tutte le richieste interne, garantendo che solo i servizi autorizzati possano scambiare dati. Il controllo degli accessi in base al ruolo (RBAC) limita l'accesso ai dati sensibili per le operazioni necessarie, impedendo persino agli utenti e ai servizi autorizzati di superare le proprie autorizzazioni.\n\nPer garantire una maggiore sicurezza, conduciamo regolarmente revisioni della sicurezza e scansioni delle vulnerabilità per garantire che tutti i sistemi sottostiano agli standard e alle best practice più recenti. Il team di sicurezza di {brandName} monitora attentamente le minacce emergenti, intervenendo rapidamente in caso di qualsiasi potenziale incidente. In ultimo, ma non per importanza, i dipendenti seguono una formazione costante in materia di sicurezza per implementare quotidianamente le migliori pressi relative alla sicurezza.\n\n{brandName} reputa fondamentale la tua fiducia e quindi lavora costantemente per tutelare la privacy e la sicurezza dei dati degli utenti. Questo viene fatto migliorando costantemente le misure di sicurezza per garantire una maggiore protezione dalle minacce informatiche sempre più sofisticate. Queste misure mirano a fornire un ambiente di trading sicuro, consentendo ai nostri utenti di operare nei mercati in piena tranquillità e sicurezza.",
