  "aboutus.feature1": "Prodotti basati sulla tecnologia",
  "aboutus.feature1.intro": "Stiamo usando al meglio tecnologie avanguardistiche per creare servizi utili volti a migliorare l'accessibilità alla rivoluzione blockchain.",
  "aboutus.feature2": "Una comunità per tutti",
  "aboutus.feature2.intro": "Come exchange creato e incentrato sulle persone, {brandName} sta sviluppando una comunità che permetta a tutti di condividere le proprie opinioni e beneficiare della crescita.",
  "aboutus.feature3": "KCS dà vita all'ecosistema di {brandName}",
  "aboutus.feature3.intro": "Stiamo sviluppando un ecosistema attorno al token di {brandName} (KCS), che fungerà da guida nel fiorente mondo decentralizzato costruito congiuntamente da tutti i membri della comunità {brandName}.",
  "aboutus.press": "Press",
  "aboutus.story": "La nostra storia",
  "aboutus.story.intro": "{brandName} è stato creato da due fanatici della tecnologia: tra i primi a usare la blockchain. Michael, dopo aver cominciato a programmare all'età di 8 anni, e aver fondato la sua prima startup all'età di 16 anni, iniziò immediatamente con il mining di BTC dopo che, nel 2012, il suo capo Eric gli aveva parlato di Bitcoin. Una volta giunto il momento di vendere alcuni BTC su Mt. Gox, dovette confrontarsi con le difficoltà di un principiante innanzi a quella che all'epoca era la piattaforma più grande al mondo. L'adozione della blockchain continuava e Michael ed Eric si resero conto di come questa stesse rimodellando il sistema finanziario, consentendo non solo ai più ricchi di trarne profitto, ma garantendo questa possibilità a chiunque, anche agli individui meno istruiti, disoccupati e senza accesso ai servizi bancari. Nel 2013, in un bar, iniziarono a scrivere le prime stringhe del codice di {brandName}, avviando un exchange dedicato alle persone con l'idea di consentire a chiunque di divenire parte del mondo delle criptovalute.",
  "aboutus.ten.item1": "Rispetta il mercato finanziario e gestisce i rischi",
  "aboutus.ten.item10": "Professionalità ed esperienza",
  "aboutus.ten.item2": "Si focalizza sul business e si concentra sull'utente",
  "aboutus.ten.item3": "Stabilisce obiettivi ambiziosi e si muove nella giusta direzione",
  "aboutus.ten.item4": "Massimizza i ricavi e utilizza al meglio in fondi",
  "aboutus.ten.item5": "Accetta la responsabilità per i risultati mantenendo una mentalità basata sui dati",
  "aboutus.ten.item6": "Accetta le sfide e reagisce rapidamente ai cambiamenti",
  "aboutus.ten.item7": "Coopera in modo attento per ottenere risultati mutualmente vantaggiosi",
  "aboutus.ten.item8": "Chiarezza e franchezza nelle comunicazioni",
  "aboutus.ten.item9": "Affronta le sfide a testa alta",
  "aboutus.ten.title": "I dieci principi di {brandName}",
  "aboutus.title": "La nostra missione è quella di facilitare <br/> la libera circolazione mondiale del valore digitale",
  "aboutus.title.intro": "{brandName} crede che il progresso tecnologico rivoluzionerà il modo in cui creiamo e distribuiamo valore. Un giorno, tutti verranno coinvolti nel mondo delle criptovalute.",
