  "asset.debts": "Debiti",
  "asset.faq.answer.one": "L'Account di deposito viene utilizzato per i depositi, i prelievi e gli acquisti di criptovalute tramite carte di credito/debito, nonché per i prestiti di margine. L'Account di trading viene utilizzato per il trading di criptovalute. L'Account a margine viene utilizzato per richiedere prestiti di margine e per le relative attività di trading. L'Account future viene utilizzato per il trading nei mercati future. L'Account finanziario viene utilizzato per lo staking e la gestione finanziaria, con un rendimento annuo fino al 20%.",
  "asset.faq.answer.oneNew": "L'Account di deposito viene utilizzato per i depositi, i prelievi e gli acquisti di criptovalute tramite carte di credito/debito, nonché per i prestiti di margine. L'Account di trading viene utilizzato per il trading di criptovalute. L'Account a margine viene utilizzato per richiedere prestiti di margine e per le relative attività di trading. L'Account future viene utilizzato per il trading nei mercati future. L'Account finanziario viene utilizzato per lo staking e la gestione finanziaria, consentendo un rendimento annuo fino al 20%.",
  "asset.faq.answer.two": "I prestiti si riferiscono alla quantità di criptovalute prestata dall'Account di deposito nel mercato a margine. Le passività si riferiscono alla quantità di criptovalute prese in prestito nell'Account a margine dal mercato a margine. Sia le passività che i prestiti sono inclusi nel valore stimato del tuo account. Nota: i prestiti non genereranno bonus KCS ma le passività sì.",
