  "assets.por.audit.intro.info": "Alle {auditTime} UTC+8, gli asset vengono crittografati e aggregati in Merkle-tree. I dati attuali sugli asset dell'account rappresentano la foglia del Merkle-tree. Finché la radice del Merkle-tree rimane invariata, gli asset corrispondenti nella relativa foglia non possono essere modificati.",
