  "assets.por.audit.progress": "Processo di revisione",
  "assets.por.audit.progress.content1": "In un momento prestabilito, verrà effettuata un'istantanea di tutti gli asset dell'utente e questi verranno archiviati e crittografati. Il personale addetto alla verifica si assicurerà dell'inclusione di ogni asset dell'utente.",
  "assets.por.audit.progress.content2": "Il saldo e l'UID di ciascun utente costituiscono una foglia del Merkle-tree, mentre la somma di tutti gli asset dell'utente costituisce il Merkle-tree.<br/> Una volta generato il Merkle-tree, qualsiasi modifica verrà individuata.",
  "assets.por.audit.progress.content3": "Al momento dell'istantanea, ogni tipo di asset ha i corrispondenti indirizzi verificabili e le loro altezze di blocco.<br/>\nEsiste anche uno metodo di controllo speciale per verificare la titolarità degli indirizzi del wallet.",
  "assets.por.audit.progress.content4": "Riserve al momento dell'istantanea = Asset negli indirizzi del wallet / Totale degli asset nel Merkle-tree.",
