  "assets.por.audit.verify": "Processo di verifica",
  "assets.por.audit.verify.content1": "Tieni presente che alcuni fattori, come l'orario dell'istantanea e i tipi di asset all'interno dell'account, potrebbero causare discrepanze negli asset presenti attualmente nel tuo account.",
  "assets.por.audit.verify.content2": "Se la verifica viene superata, i tuoi asset sono conservati e custoditi in sicurezza.<br/>\nPoiché tutti possono partecipare alla verifica, l'importo totale degli asset degli utenti sulla piattaforma può essere attendibile.",
