  "assetsBack.cs.airCoin.applyDes": "Ti invitiamo a verificare i dettagli della tua richiesta. Una volta approvata, ti informeremo in merito alla commissione di servizio applicabile: questa verrà detratta dal tuo account di deposito per completare il processo di recupero degli asset. <br>Nel caso sia impossibile recuperare i tuoi asset o nel caso il motivo del mancato deposito non sia riconducibile a un tuo errore, nessun costo aggiuntivo ti verrà addebitato. Se accetti questi termini, clicca su \"Conferma\" e procederemo all'elaborazione della tua richiesta.",
  "assetsBack.cs.airCoin.reason1": "<span>Nel caso la rete blockchain della criptovaluta depositata non sia supportata da {brandName} o <span class='{style}'>se la criptovaluta depositata non è quotata o {brandName} ne abbia effettuato il delisting</span>, il deposito non verrà accreditato.</span>",
  "assetsBack.cs.airCoin.reason2": "<span>Per garantire la sicurezza dei tuoi fondi, <span class='{style}'>possiamo restituire il tuo deposito solo all'indirizzo blockchain originario, dopo che questo sia stato approvato. Il riferimento TxID del rimborso ti verrà fornito. In caso di circostanze particolari, contatta la nostra assistenza clienti ufficiale all'indirizzo support@kucoin.com.</span> Se l'indirizzo originario del deposito è di un'altra piattaforma, contatta la loro assistenza per comprendere i passaggi successivi da intraprendere una volta che avremo completato il rimborso.</span>",
