  "assetsBack.form.errMsg5": "Formato non valido. Sono supportati solo i file {type}.",
  "assetsBack.form.tips1": "Per mantenere sicuri i tuoi fondi, <span class='{style}'>possiamo restituire i fondi da te depositati solo inviandoli all'indirizzo del blocco originario senza memo, tag o messaggi.</span> Nel caso l'indirizzo originario del deposito sia proprietà di una piattaforma, contattala per ricevere assistenza successivamente alla restituzione dei fondi da parte di KuCoin. Nel caso di circostanze particolari a te riferite, contatta il servizio clienti all'indirizzo support@kucoin.com.",
  "assetsBack.form.tips2": "Nota: per salvaguardare i tuoi asset, possiamo restituire i fondi recuperati solo all'indirizzo originario del deposito (ovvero all'indirizzo da cui sono stati inviati sulla blockchain). Per qualsiasi circostanza speciale, contatta il nostro servizio clienti all'indirizzo support@kucoin.com. Nel caso l'indirizzo di restituzione sia un hot wallet che appartiene a una piattaforma differente, una volta completato il rimborso da parte nostra dovrai contattare tale piattaforma per ulteriore assistenza.",
  "assetsBack.form.tooltip1": "Seleziona la moneta depositata dal menu a tendina. Se non vedi la tua moneta, inseriscila manualmente.",
  "assetsBack.reason1": "Durante il deposito hai dimenticato di specificare un Tag/Memo oppure lo hai specificato erroneamente.",
  "assetsBack.reason1.confirmModelDes": "Conferma la correttezza delle informazioni nella tua richiesta. Una volta approvata la tua richiesta, ti avviseremo in merito al pagamento delle commissioni corrispondenti. Dopo aver completato la tua richiesta, ti forniremo il TxID del deposito restituito.",
  "assetsBack.reason1.des1": "Per alcune criptovalute, come XLM, EOS ed XRP, durante il processo di deposito è necessario compilare un tag o un memo. Nel caso non vengano inseriti in modo corretto sia l'indirizzo che il tag, il deposito fallirà.",
  "assetsBack.reason1.des2": "Per garantire la sicurezza dei tuoi fondi, <span class='{style}'>possiamo restituire i fondi depositati solo all'indirizzo di origine senza la presenza di alcun memo, tag o messaggi. Verrà fornito il TxID dei fondi restituiti. </span>Nel caso l'indirizzo originario del deposito appartenga a un'altra piattaforma, una volta completato il reso da parte nostra dovrai contattare tale piattaforma per ulteriore assistenza. In caso di circostanze particolari, contattaci all'indirizzo support@kucoin.com.",
  "assetsBack.reason1.des3": "Nel caso tu abbia accidentalmente specificato un tag o un memo appartenente a un altro utente, i tuoi fondi potrebbero essere stati depositati su tale conto. Purtroppo, in questi casi non siamo in grado di fornire ulteriore assistenza.",
