  "beginnerZone.rule": "Regole",
  "beginnerZone.rule.item1": "1. L'evento inizia in data {date} e si svolge per un periodo limitato.",
  "beginnerZone.rule.item2": "2. Iscriviti per aggiudicarti una Mystery Box e vinci fino a {num1} USDT. Possono partecipare solo i nuovi utenti che si siano registrati con successo su {brandName} durante l'evento. Dopo la registrazione, i nuovi utenti hanno la possibilità di vincere una Mystery Box con valore massimo pari a {num2} USDT.",
  "beginnerZone.rule.item3": "3. Completa il tuo primo deposito/acquisto di criptovalute e vinci fino a {num1} USDT. Possono partecipare solo gli utenti che non abbiano mai depositato/acquistato criptovalute su {brandName} prima dell'evento. Gli utenti il cui primo deposito/acquisto di criptovalute abbia un importo pari ad almeno {num2} USD (sono validi depositi/acquisti di ogni criptovaluta, il valore verrà calcolato in base al prezzo della criptovaluta al momento del deposito/acquisto) potranno partecipare all'estrazione a sorte per vincere una Mystery Box con valore massimo pari a {num3} USDT.",
  "beginnerZone.rule.item4": "4. Per completare l'attività gli utenti possono depositare o acquistare criptovalute usando differenti servizi: Operazione Rapida, P2P e pagamenti tramite terze parti. I pacchetti rossi e i fondi di prova non contano.",
  "beginnerZone.rule.item5": "5. Completa la tua prima operazione e vinci fino a {num1} USD. Possono partecipare solo coloro che non abbiano mai eseguito operazioni su {brandName} prima dell'evento. Gli utenti che durante l'evento abbiano eseguito la prima operazione, con un valore minimo pari a {num2} USD, potranno partecipare all'estrazione a sorte per vincere due Mystery Box con valore massimo pari a {num3} USD. Il volume di trading, il cui tasso delle commissioni sia pari a 0, non viene conteggiato ai fini di questo evento.",
  "beginnerZone.rule.item6": "6. Le operazioni valide includono le operazioni spot e nei mercati future, l'acquisto di prodotti {brandName} Earn, le operazioni effettuate tramite trading bot e il trading con margine. I valori vengono calcolati in base all'importo della transazione quando l'ordine viene piazzato correttamente.",
  "beginnerZone.rule.item7": "7. Potrebbe verificarsi un ritardo nell'aggiornamento dei dati. Nel caso i dati non siano stati aggiornati, prova a ricaricare la pagina o contatta il servizio clienti.",
  "beginnerZone.rule.item8": "8. Le ricompense vengono normalmente emesse entro {num} giorni, anche se potrebbero verificarsi dei ritardi. Quando si utilizza un coupon di detrazione fiat, l'importo detratto verrà rimborsato dopo aver piazzato l'ordine.",
  "beginnerZone.rule.item9": "9. Le ricompense nelle Mystery Box possono includere: coupon di detrazione per i future, fondi di prova per i future, coupon incrementali, coupon di detrazione fiat, monete popolari, coupon di rimborso delle commissioni di trading, bonus per il margine, coupon a interessi zero e altri premi.",
