  "creator.fifth.step2.sub1": "Puoi creare contenuti di qualsiasi tipo, compresi tra gli altri video, articoli, infografiche, immagini e podcast. Se hai altre idee interessanti, faccelo sapere.",
  "creator.fifth.step2.sub2": "Prima di iniziare a creare, assicurati di consultare le regole e i requisiti relativi all’argomento scelto. Assicurati di consultare i nostri <span>suggerimenti</span> per perfezionare i tuoi contenuti.",
  "creator.fifth.step2.title": "Crea i tuoi contenuti",
  "creator.fifth.step3.sub": "Pubblica i tuoi contenuti sui tuoi canali di social media con l’hashtag #RiceviBTCGratuiticon{brandName}.",
  "creator.fifth.step3.title": "Pubblica e condividi i tuoi contenuti",
  "creator.fifth.step4.sub1": "Dopo aver completato il passaggio 3, invia i tuoi contenuti riempiendo in ogni sua parte il modulo di invio.",
  "creator.fifth.step4.sub2": "Assicurati di completare tutti i passaggi e di inviare i tuoi contenuti entro la fine di ciascun mese. Il mancato invio del modulo annullerà il tuo diritto ad ottenere la ricompensa.",
  "creator.fifth.step4.title": "Invia i tuoi contenuti",
  "creator.fifth.step5.sub1": "{brandName} valuterà i tuoi contenuti in base al loro livello generale di qualità e di influenza.",
  "creator.fifth.step5.sub2": "I vincitori delle ricompense riceveranno un’e-mail entro il giorno 10 del mese successivo.",
  "creator.fifth.step5.sub3": "Le ricompense verranno accreditate il giorno 15 di tale mese.",
  "creator.fifth.step5.title": "Ottieni le tue ricompense in Bitcoin",
  "creator.fifth.title": "Come partecipare al programma",
  "creator.first.sub": "Crea e condividi contenuti con il tuo pubblico per guadagnare Bitcoin gratuiti!",
  "creator.first.title": "Programma per creatori di contenuti {brandName}",
  "creator.fourth.title": "Sfide di contenuto",
  "creator.ninth.item1.sub": "Ciascun creatore ha il diritto di ricevere ricompense gratuite in Bitcoin per un massimo di 3 contenuti per lingua.",
  "creator.ninth.item1.title": "Ricompense",
  "creator.ninth.item2.sub": "Per avere il diritto di ricevere ricompense, i contenuti possono essere inviati entro l’ultimo giorno del mese.",
  "creator.ninth.item2.title": "Termine per l’invio",
  "creator.ninth.item3.sub": "{brandName} si riserva tutti i diritti legati all’interpretazione finale dei criteri di valutazione dei contenuti.",
  "creator.ninth.item3.title": "Valutazione dei contenuti",
  "creator.ninth.item4.sub": "{brandName} si riserva i diritti di aggiornare, modificare, revisionare e pubblicare nuovamente qualsiasi contenuto inviato al programma senza alcun preavviso.",
  "creator.ninth.item4.title": "Contenuti pubblicati",
  "creator.ninth.item5.sub": "Il plagio di contenuti o altre condotte disoneste squalificheranno il partecipante dal programma.",
  "creator.ninth.item5.title": "Plagio",
  "creator.ninth.item6.sub": "Partecipando al programma, l’utente accetta di trasferire i diritti di copyright dei proprio lavori a {brandName}. {brandName} si riserva tutti i diritti di revisionare le regole del programma.",
  "creator.ninth.item6.title": "Revisione delle regole",
  "creator.ninth.title": "Termini e condizioni",
  "creator.second.btn": "Invia i contenuti",
  "creator.second.sub": "{brandName} è alla ricerca di creatori di contenuti di talento in grado di generare contenuto di alta qualità. I creatori migliori possono guadagnare fino 2.750$ in BTC al mese. Comincia a far fruttare la tua creatività ORA!",
  "creator.second.title": "Trasforma la tua creatività in Bitcoin",
  "creator.seventh.item1.sub": "Chiunque abbia una passione per le criptovalute e la creazione di contenuti è invitato a partecipare al programma per ricevere ricompense in Bitcoin in cambio dei propri contributi.",
  "creator.seventh.item1.title": "Chi può partecipare al Programma per creatori di contenuti?",
  "creator.seventh.item2.sub": "Sì, certo. Il nostro Programma per creatori di contenuti è indipendente da quelli di presentazione e di affiliazione. In ogni caso, non hai il diritto di partecipare a questo programma usufruendo di lavori utilizzati in precedenza per altri programmi.",
  "creator.seventh.item2.title": "Posso partecipare a questo programma anche se ho già partecipato al programma di presentazione o a quello di affiliazione {brandName}?",
  "creator.seventh.item3.sub": "I tuoi lavori verranno valutati in base a fattori come qualità, creatività e influenza. Per maggiori informazioni, consulta i nostri <span>suggerimenti per la creazione di contenuti</span>.",
  "creator.seventh.item3.title": "Quali sono i criteri di valutazione dei miei contenuti?",
  "creator.seventh.item4.sub": "Riceverai le tue ricompense in Bitcoin il giorno 15 del mese successivo all’evento.",
  "creator.seventh.item4.title": "Quando riceverò le ricompense, se vinco?",
  "creator.seventh.item5.sub": "Dalla pagina degli asset puoi visualizzare le tue ricompense in Bitcoin nel tuo Account di deposito.",
  "creator.seventh.item5.title": "Come verifico le mie ricompense in Bitcoin?",
  "creator.seventh.title": "FAQ",
  "creator.sixth.item1.sub1": "Ogni mese, {brandName} selezionerà il miglior creatore in ciascuna lingua.",
  "creator.sixth.item1.sub2": "Il creatore migliore riceverà un bonus aggiuntivo in Bitcoin del valore di 1.250$.",
  "creator.sixth.item1.title": "Bonus per i creatori migliori",
  "creator.sixth.item2.sub": "I creatori che si distinguono avranno l’opportunità di comparire in primo piano sui canali social ufficiali di {brandName}.",
  "creator.sixth.item2.title": "Raccomandazioni in primo piano",
  "creator.sixth.item3.sub": "I creatori di contenuti che si distinguono avranno l’opportunità di diventare certificati e lavorare come collaboratori a lungo termine per scrivere notizie e articoli su {brandName}.",
  "creator.sixth.item3.title": "Creatore certificato {brandName}",
  "creator.sixth.title": "Bonus aggiuntivi per creatori",
  "creator.third.li1": "Il programma presenterà un evento al mese, con vari argomenti tra cui i creatori posso scegliere. I creatori possono selezionare argomenti di loro interesse e inviare i contenuti scritti a riguardo a {brandName}. Ciascun contenuto selezionato da {brandName} riceverà ricompense in Bitcoin del valore di 500$.",
  "creator.third.li2": "Ciascun creatore può guadagnare ricompense gratuite in Bitcoin per un massimo di tre contenuti al mese.",
  "creator.third.li3": "Per il momento, accettiamo solo contenuti scritti in lingua inglese. Ti faremo sapere non appena avremo aggiunto altre lingue.",
  "creator.third.title": "Fantastiche ricompense per i creatori di contenuti",
