  "e33cc27873fc4000a9b0": "Per proteggere efficacemente gli account degli utenti, {brandName} applica dei requisiti complessi per le password. Queste devono includere una lettera maiuscola, una lettera minuscola, un numero e avere una lunghezza compresa tra 10 e 32 caratteri.",
