  "eJHZJFh1qjq2ZxGMR7oVbm": "Visualizza",
  "ePUBvxK9udnMJNg6hoSLnL": "Quando un miner contribuisce con la propria potenza computazionale a BTC.com e successivamente genera correttamente un blocco di Bitcoin, riceverà il 98,5% della ricompensa del blocco. BTC.com tratterrà l'1,5% come commissione per la fornitura del mining pool.",
