  "etf.action.toTrade": "Fai trading",
  "etf.answer.five.content1": "a) Commissione di negoziazione: verrà addebitata al momento dell'acquisto / vendita di Token a Leva nel mercato spot. Il livello delle commissioni è lo stesso di quello del trading spot.",
  "etf.answer.five.content2": "b) Commissione di sottoscrizione: verrà addebitata al momento della sottoscrizione dei Token a Leva. Attualmente è lo {feeRate}%.",
  "etf.answer.five.content3": "c) Commissione di riscatto: verrà addebitata al momento del riscatto dei Token a Leva. Attualmente è lo {feeRate}%.",
  "etf.answer.five.content4": "d) Commissione di gestione: verrà addebitata alle 07:45 (UTC + 8) ogni giorno, pari allo {managementFees}%. La commissione sarà incorporata nel valore patrimoniale netto dei Token a Leva e non influenzerà il tuo saldo. Il sistema continuerà ad addebitarti le commissioni di gestione, quindi fai attenzione quando detieni Token a Leva finanziaria a lungo termine.",
  "etf.answer.five.tilte": "Le commissioni generate dai Token a Leva {brandName} sono le seguenti:",
  "etf.answer.one": "I Token a Leva {brandName} sono asset nel mercato Spot {brandName} con leva sui profitti in base alle posizioni long/short dell'asset sottostante. Ad esempio, se BTC sale dell'1% allora BTC3L sale del 3% mentre BTC3S scende del 3%. Diversamente dal margin trade o dai futures detenere questi asset non richiede il mantenimento di un margine quindi non esiste il rischio di liquidazione forzata. Sono comunque esposti ad alta volatilità del prezzo del token a leva quindi investite con prudenza.",
  "etf.answer.six.content1": "a) Rispetto al mercato spot, il mercato dei Token a Leva presenta rischi e incertezze maggiori. I Token a Leva possono generare importanti profitti o perdite intraday.",
  "etf.answer.six.content2": "b) A causa del meccanismo di ribilanciamento e delle commissioni di gestione, più a lungo detieni i Token a Leva, più commissioni paghi. Pertanto, presta attenzione quando detieni questo tipo di token per periodi prolungati.",
  "etf.answer.step1.content": "Puoi scambiare i Token a Leva leva nel mercato spot {brandName}. Vai alla pagina dei token con leva e cerca i tuoi preferiti, fai clic su 'Trade' per acquistare o vendere.",
  "etf.answer.step1.title": "1) Mercato Spot {brandName} (consigliato)",
  "etf.answer.step2.content": "{brandName} elaborerà le richieste di sottoscrizione e riscatto ogni giorno alle {unifiedSubmissionTimePoints}. I prezzi di sottoscrizione / rimborso sono determinati da quelli di esecuzione, quindi possono esserci incertezze sul tempo e sul prezzo. Sii prudente con le tue decisioni di trading.",
  "etf.answer.step2.title": "2) Sottoscrizione/Riscatto",
  "etf.answer.three": "A causa del meccanismo di ribilanciamento, i Token a Leva {brandName} sono buone scelte per movimenti di mercato unilaterali mentre non sono adatti per i mercati con grandi fluttuazioni. In presenza di grande volatilità possono esserci maggiori perdite nette intraday, investite con prudenza.",
  "etf.answer.two": "I Token a Leva {brandName} sono come una quota di un fondo a leva. Il gestore del fondo garantirà che il rendimento del fondo si basi su un multiplo specifico dell'asset sottostante e che i trader possano ottenere quel multiplo specifico dei profitti dell'asset sottostante. Quando la volatilità dei prezzi sul lato opposto supera una certa soglia, il sistema introdurrà un meccanismo di ribilanciamento a copertura dei rischi, assicurandosi che la perdita netta sia sotto controllo.",
  "etf.apply.alert": "<div>L'elaborazione giornaliera avviene alle {unifiedSubmissionTimePoints}. I prezzi di sottoscrizione e riscatto si basano sull'ultima operazione completata. </div> <div>Per ridurre qualsiasi rischio o incertezza, ti consigliamo di utilizzare il trading spot.</div> <div class='tip'>Nota: al momento della sottoscrizione o del riscatto, i tuoi asset verranno sempre accreditati al successivo orario di elaborazione programmato.</div>",
