  "fRZbnDHRT6v7UEKnj6JBjh": "<span>Aggiorna regolarmente il tuo wallet:</span> aggiornare il software del wallet ti garantisce l'installazione delle patch di sicurezza e delle correzioni più recenti alle vulnerabilità note.",
