  "kw9PuiVyLd1aXXR8kFGKDf": "Ai sensi della Sezione 194S della legge relativa alle imposte sul reddito, del 1961, in India, su ogni operazione verrà applicata un'imposta dedotta all'origine (TDS): pari all'{percent} sul valore dell'operazione, come definito dalle linee guida stilate dal governo in materia di trasferimenti di asset digitali virtuali (VDA). Puoi richiedere tale TDS al momento della presentazione della dichiarazione dei redditi (ITR).",
