  "aboutus.roadmap.2023.q3": "<p>{brandName} lancia <b>Pre-Market Trading</b>, il primo prodotto OTC del settore</p><p>{brandName} rilascia <b>Margin Grid</b>, una nuova strategia per i trading bot con margine</p>",
