  "aboutus.roadmap.2024.q1": "<p><b>KuCard x Apple Pay</b>: ora, la carta Visa di {brandName} per le criptovalute supporta Apple Pay</p><p><b>Leadership normativa in India</b>: {brandName} apre la strada alla conformità FIU tra gli exchange di criptovalute globali</p><p>{brandName} rilascia <b>Futures Martingale</b>, una nuova strategia per i trading bot sui future</p>",
  "aboutus.roadmap.2024.q2": "<p>{brandName} lancia GemSlot e GemPool per il listing dei token</p><p>{brandName} rilascia <b>AI Futures Trend</b>, una nuova strategia per i trading bot sui future</p><p>{brandName} Futures introduce gli ordini limite avanzati, garantendo agli utenti una maggiore flessibilità di trading</p>",
  "aboutus.roadmap.2024.q3": "<p>{brandName} celebra 7 anni: \"7rust {brandName}, Own Your Future\"</p><p>{brandName} Futures introduce il <b>margine cross</b>, migliorando l'efficienza del capitale</p><p><b>Auto-Earn</b>: una funzione per aggiungere facilmente i fondi inattivi ai risparmi flessibili per generare rendimenti stabili</p><p><b>Smart Earn</b>: uno strumento di{brandName} Earn che offre consigli personalizzati in base alle preferenze e ai livelli di rischio</p><p><b>Aggiornamenti dei Trading Bot</b>: interfaccia utente rinnovata e nuove modalità per i trading bot, con 12 strategie automatizzate adatte a diverse condizioni di mercato</p><p></p>",
  "aboutus.roadmap.2024.q4": "<p>{brandName} lancia il <b>trading di opzioni</b> avanzato, ampliando le strategie di trading e gli strumenti di gestione del rischio</p><p>{brandName} lancia <b>Futures Perks</b>, un'interfaccia dedicata con promozioni esclusive per i trader di future</p><p>{brandName} rilascia <b>Copy Trading Futures</b>, consentendo la copia in tempo reale delle strategie e l'integrazione delle operazioni dei lead trader</p><p><b>News Flash</b>: un flusso di notizie basato sull'intelligenza artificiale con approfondimenti di mercato mirati</p><p><b>{brandName} Research</b>: un nuovo hub che contiene risorse per l'analisi settoriale e i resoconti sui progetti</p><p><b>{brandName} Learn and Earn</b>: una modalità interattiva per guadagnare criptovalute gratis attraverso l'apprendimento</p>",
  "aboutus.roadmap.2025.q1": "<p><b>{brandName} Pay</b>: una soluzione commerciale per eseguire pagamenti semplificati in criptovaluta</p><p><b>{brandName} News</b>: aggiornamenti di mercato in tempo reale sugli sviluppi relativi a Bitcoin, altcoin e Web3</p>",
