  "026968b084d24000a02b": "Vantaggi dell'ecosistema KCS",
  "05e3c1d361f74000abe8": "Metaverso di social gaming",
  "087f119ac6bd4000aa0d": "TRGC è un fondo di asset digitali dedicato agli investimenti in opportunità trasformative che porteranno al prossimo cambiamento significativo di Internet.",
  "0df6bb1fff2e4000af72": "Goditi commissioni ridotte, premi esclusivi e una partecipazione diretta al futuro di KuCoin attraverso il nostro fiorente ecosistema KCS.",
  "185af89739e74000aace": "Entra a far parte di una comunità globale dinamica che prospera grazie a: collaborazione, innovazione e inclusione finanziaria.",
  "23a3d14b6cf34000a882": "Contattaci.",
  "24e8b825a97b4000a553": "I vantaggi che offriamo",
  "288ee3f258534000a134": "KuCoin Ventures investe e supporta progetti blockchain innovativi in settori come infrastrutture, DeFi, NFT e SocialFi, alimentando la continua crescita dell'ecosistema Web3.",
  "2bc2d33b535b4000ac09": "La nostra evoluzione è costante per soddisfare le esigenze dei trader moderni: offriamo strumenti all'avanguardia e un'esperienza di trading senza interruzioni.",
  "2ecd9e9b835f4000af50": "Infrastruttura per l'interoperabilità Web3",
  "3a1d43481cdb4000a587": "E-mail",
  "3ccc4f64a7ab4000a0e2": "In qualità d'investitore orientato alla ricerca e incentrato sulla comunità, KuCoin Ventures collabora a stretto contatto con i progetti presenti nel proprio portafoglio durante il loro intero ciclo di vita, con particolare attenzione alle infrastrutture DeFi, GameFi e Web3.",
  "3ced5ea1db9f4000af5b": "ZK-rollup decentralizzato, equivalente a Ethereum",
  "4e0b5341981e4000a9af": "Sicurezza prima di tutto",
  "581fedf360194000a8ec": "Sistema operativo decentralizzato",
  "59faeed1a8cf4000a094": "L1 walletless per astrazione a catena",
  "5bd44eada21d4000ae67": "KuCoin Ventures supporta gli sviluppatori di criptovalute e Web3, sia finanziariamente che strategicamente, offrendo conoscenze approfondite e utilizzando al meglio le risorse globali",
  "5d01bcc193c54000a0c1": "Visualizza i ruoli disponibili",
  "5d0321509ade4000afe7": "Exchange decentralizzato all-in-one",
  "5eedfcd04c8e4000a152": "Trading innovativo",
  "639afd5beda54000a272": "Uniamo le forze per dare forma al futuro",
  "64f878358ab64000a8d0": "Incubatore Web3",
  "67f9cb69ac0e4000a169": "Unisciti a KuCoin ed entra a far parte di un futuro costruito su trasparenza, integrità e passione.",
  "6a1ac3fe9f8f4000ab62": "Divenire un'azienda rispettata a livello mondiale in ambito tecnologico e in grado di guidare l'innovazione nel settore delle criptovalute.",
  "6ea33259dec64000a53d": "Sistemi sociali Web3",
  "7524379504f44000ac34": "Consentire il <span class='hl-text'>libero flusso del <br/>valore digitale in tutto il mondo</span>",
  "7762b1cabbcf4000a1cd": "La tua sicurezza è la nostra massima priorità. Salvaguardiamo i tuoi asset proteggendoli grazie a tecnologie leader del settore, garantendoti la massima tranquillità.",
  "7b43d074282b4000a338": "Tutto cominciò con Michael, un appassionato programmatore che a soli 8 anni iniziò a programmare e a 16 lanciò la sua prima startup. Nel 2012 scoprì Bitcoin attraverso il suo capo, Eric, e i due si tuffarono subito a capofitto nel mondo del mining. Tuttavia, quando Michael tentò di vendere alcuni BTC su Mt. Gox, il più grande exchange dell'epoca, si rese subito conto di quanto il trading di criptovalute fosse difficile e inaccessibile per i nuovi arrivati, nonostante il suo immenso potenziale di rimodellare il panorama finanziario.",
  "7d7838da36ea4000a98c": "App store Web3 di criptovalute multi-chain",
  "7fa0d0df97424000a257": "La blockchain ottimizzata per i giocatori",
  "86f4b83859364000aaa7": "SocialFi app",
  "8891a013712e4000a472": "Quando l'adozione della blockchain iniziò ad accelerare, Michael ed Eric capirono il suo potere trasformativo, non solo per i ricchi, ma per chiunque, compresi coloro esclusi dai servizi bancari e gli svantaggiati. Alla fine del 2013, si trovarono in un bar e scrissero le prime righe di codice per quello che sarebbe diventato KuCoin, l'exchange delle persone, una piattaforma progettata per abbattere le barriere e rendere le criptovalute accessibili a tutti.",
  "8eb597d442274000a1ee": "Mercato monetario dell'ecosistema SUI",
  "931d0a8829fa4000aab0": "Accelerare l'adozione della tecnologia blockchain e delle criptovalute consentendo il libero flusso di valore digitale in tutto il mondo.",
  "9adf29707ebc4000a467": "Missione",
  "a23f71374c5e4000a362": "Il principale ramo d'investimento dell'exchange di KuCoin",
  "a4d0df02a97f4000a741": "Exchange di rendimenti sintetici a leva",
  "b64124e449ee4000a742": "Editore e sviluppatore di giochi play-and-earn multipiattaforma",
  "b84161bcdd5e4000a70b": "La nostra storia",
  "babf517cd7614000a650": "KuCoin Ventures collabora con i principali fondi d'investimento per supportare progetti blockchain innovativi, favorendo la crescita dell'ecosistema Web3 e delle criptovalute.",
  "c10b4e0fdd304000ab1d": "Rafforzamento del <span class=\"web3\">Web3</span> e delle <span class=\"tech\">tecnologie di nuova generazione</span>",
